import React, { useState } from "react"
import ListPosts from "../../components/ListPosts"

const ProfilePage = () => {

    const data = [
        {
            id: 1,
            displayName: 'John Doe',
            createdAt: '2020-01-01',
            content: 'day la bai dang mau',
            likes: 0,
            comments: 0,
        }, {
            id: 2,
            displayName: 'John Doe',
            createdAt: '2020-01-01',
            content: 'day la bai dang mau',
            likes: 0,
            comments: 0,
        }, {
            id: 3,
            displayName: 'John Doe',
            createdAt: '2020-01-01',
            content: 'day la bai dang mau',
            likes: 0,
            comments: 0,
        }, {
            id: 4,
            displayName: 'John Doe',
            createdAt: '2020-01-01',
            content: 'day la bai dang mau',
            likes: 0,
            comments: 0,
        }
    ]


    return (
        <div>
            <h1>Profile Page</h1>

            <ListPosts posts={data } />
        </div>
    )
}


export default ProfilePage
